import "./Views/LandingViews.css"
import Card from "react-bootstrap/Card";

const Landing = () => {

    return (
        <Card
          className="Landing"
          border="primary"
          style={{ height: "100%", width: "100%", border: "danger" }}
        >
          <Card.Header as="h1">
            {" "}
            <Card.Title>Welcome!</Card.Title>{" "}
          </Card.Header>
          <Card.Body className="LandingBody">
            <Card border="secondary" className="AtoS">
              <Card.Body>
                <img
                  src="https://pbs.twimg.com/profile_images/1431129444362579971/jGrgSKDD_400x400.jpg"
                  style={{ height: "5%", width: "5%" }}
                />
                <img
                  src="https://i.pinimg.com/736x/f6/f5/11/f6f511b959f9566571df8bbb0981752c.jpg"
                  style={{ height: "5%", width: "5%" }}
                />
                <img
                  src="https://upload.wikimedia.org/wikipedia/commons/thumb/1/19/Spotify_logo_without_text.svg/800px-Spotify_logo_without_text.svg.png"
                  style={{ height: "5%", width: "5%" }}
                />
              </Card.Body>
            </Card>
            <Card className="StoA">
              <Card.Body>
                <img
                  src="https://upload.wikimedia.org/wikipedia/commons/thumb/1/19/Spotify_logo_without_text.svg/800px-Spotify_logo_without_text.svg.png"
                  style={{ height: "5%", width: "5%" }}
                />
                <img
                  src="https://i.pinimg.com/736x/f6/f5/11/f6f511b959f9566571df8bbb0981752c.jpg"
                  style={{ height: "5%", width: "5%" }}
                />
                <img
                  src="https://pbs.twimg.com/profile_images/1431129444362579971/jGrgSKDD_400x400.jpg"
                  style={{ height: "5%", width: "5%" }}
                />
              </Card.Body>
            </Card>
          </Card.Body>
        </Card>
    );
}

export default Landing;
